#define N_SIZERF sizeof(rds)/sizeof(rds[0])


struct addrs
{
	unsigned int rs1;
	unsigned int rs2;
	unsigned int rd;
	unsigned int Wen;
};

static int rs1vals[N_SIZERF];
static int rs2vals[N_SIZERF];
static int regfile [32] = {[0 ... 31] = 0};


void configtbRF(struct tbconfig *tbcfg)
{
	tbcfg->source1 = addresses;
	tbcfg->source2 = rds;
	tbcfg->sourcelen = sizeof(rds);
	tbcfg->resultslen = sizeof(rs1vals);
}

static void getAddress(struct addrs *tmp,int packet)
{
	tmp->rs1 = packet &31;
	tmp->rs2 = (packet&(31<<5))>>5;
	tmp->rd = (packet&(31<<10))>>10;
	tmp->Wen = (packet&0x8000)>>15;
}

static void RF_WriteReg (unsigned int addr, int value)
{
    if (addr && addr < 32)
        regfile[addr] = value;
}

static int RF_ReadReg(unsigned int addr)
{
    if (addr && addr < 32)
        return regfile[addr];

    return 0;
}

int GenerateResultsRegFile()
{
	struct addrs addr;
	int i;
	for (i = 32; i<N_SIZERF; i++)
	{
		getAddress(&addr,addresses[i]);
		rs1vals[i] = RF_ReadReg(addr.rs1);
		rs2vals[i] = RF_ReadReg(addr.rs2);
		if(addr.Wen)RF_WriteReg(addr.rd,rds[i]);
	}

	return i+1;
}

int CheckResultsRegFile(int *rs1check,int *rs2check)
{
	int cnt = 0;
	struct addrs addr;
	for (int i = 0; i<N_SIZERF-1;i++)
	{
		getAddress(&addr,addresses[i]);

		if (i<50 || i>(N_SIZERF-30))
		{
			xil_printf("[%d]Wen:%d, rdaddr:%d, rd:%x,\r\n",i,addr.Wen,addr.rd,rds[i]);
		}
		if(rs1check[i+1] != rs1vals[i])
		{
			cnt++;
			xil_printf("\t[!]mismatch at rs1vals[%d], expected %x, real %x, addr:%d --- \r\n",i,rs1vals[i],rs1check[i+1],addr.rs1);
		}
		if(rs2check[i+1] != rs2vals[i])
		{
			cnt++;
			xil_printf("\t[!]mismatch at rs2vals[%d], expected %x, real %x, addr:%d--- \r\n",i,rs2vals[i],rs2check[i+1],addr.rs2);
		}
	}

	return cnt;
}

